import "./index.css";
import Card from './Cards';
import Sdata from './Sdata';

// console.log();
function ncard(val) {
    console.log(val);
    return ( 
        <Card
            imgscr={val.imgscr}
            title={val.title}
            sname={val.sname}
            link={val.links}
        />
    );
}

ReactDOM.render(
    <>
        <h1 className="heading_style">List of top 5 Netflix Series</h1>

        <Card
            imgscr={Sdata[0].imgscr}
            title={Sdata[0].title}
            sname={Sdata[0].sname}
            link={Sdata[0].links}
        />

         Sdata.map(ncard);
    </>,
